// src/pages/NovoDono.jsx
import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import api from '../../services/api';

export default function NovoDono() {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    nome: '',
    cpf: '',
    endereco: '',
    dataNascimento: '',
    responsavel: '',
    telefone: '',
    email: '',
    ativo: true,
    observacoes: ''
  });
  const [errors, setErrors] = useState({});

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setForm((prev) => ({ ...prev, [name]: type === 'checkbox' ? checked : value }));
    setErrors((prev) => ({ ...prev, [name]: null }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await api.post('/donos', form);
      navigate('/donos');
    } catch (err) {
      const resp = err.response?.data;
      if (resp?.erros) {
        const fieldErrors = resp.erros.reduce(
          (acc, cur) => ({ ...acc, [cur.path]: cur.msg }), {}
        );
        setErrors(fieldErrors);
      } else {
        setErrors({ form: resp?.erro || 'Erro ao cadastrar dono' });
      }
    }
  };

  return (
    <div className="container my-5">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>Cadastrar Novo Dono</h2>
        <div>
          <Link to="/" className="btn btn-outline-secondary me-2">Voltar ao Início</Link>
          <Link to="/donos" className="btn btn-secondary">Ver Donos</Link>
        </div>
      </div>

      {errors.form && <div className="alert alert-danger">{errors.form}</div>}

      <form onSubmit={handleSubmit}>
        {['nome', 'cpf', 'endereco', 'responsavel', 'telefone', 'email'].map((field) => (
          <div key={field} className="mb-3">
            <label className="form-label text-capitalize">{field}</label>
            <input
              name={field}
              className="form-control"
              value={form[field]}
              onChange={handleChange}
              type={field === 'email' ? 'email' : 'text'}
            />
            {errors[field] && <div className="text-danger">{errors[field]}</div>}
          </div>
        ))}

        <div className="mb-3">
          <label className="form-label">Data de Nascimento</label>
          <input
            type="date"
            name="dataNascimento"
            className="form-control"
            value={form.dataNascimento}
            onChange={handleChange}
          />
          {errors.dataNascimento && <div className="text-danger">{errors.dataNascimento}</div>}
        </div>

        <div className="form-check mb-3">
          <input
            className="form-check-input"
            type="checkbox"
            name="ativo"
            checked={form.ativo}
            onChange={handleChange}
          />
          <label className="form-check-label">Ativo</label>
        </div>

        <div className="mb-3">
          <label className="form-label">Observações</label>
          <textarea
            name="observacoes"
            className="form-control"
            rows="3"
            value={form.observacoes}
            onChange={handleChange}
          />
        </div>

        <button type="submit" className="btn btn-primary">Cadastrar Dono</button>
      </form>
    </div>
  );
}
